import "./App.css";
import React, { Component } from "react";

class Fan extends Component {
  render() {
    return (
      <div className="fan">
        <div className="fanText">
          <div className="starter">
            {this.props.data.map((f) => (
              <div>
                <h4 className="fanName">{f.data.name}</h4>
                <p>{f.data.description}</p>
                <h6>{f.data.points}</h6>
                <div className="fanTiles">
                  {this.props.data.map((t) => (
                    <img className="fanImgQ" src={t.img} alt={t.alt}></img>
                  ))}
                </div>
                <h5>{this.props.exclusions}</h5>
              </div>
            ))}
          </div>
        </div>
      </div>
    );
  }
}

export default Fan;
